import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Clone Instagram App</h1>
      <div className="app_header">
        <img

          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
        />
      </div>
    </div>
  );
}

export default App;
